INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 106001, 7001, 1, -363.0, "キャル", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0.0, 7, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 105901, 7002, 1, -363.0, "コッコロ", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 0.0, 7, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 105801, 7003, 1, -363.0, "ペコリーヌ", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 0.0, 7, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 105801, 10001, 1, -363.0, "ペコリーヌ", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0.0, 10, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 106001, 10002, 1, -363.0, "キャル", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0.0, 10, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 105901, 10003, 1, -363.0, "コッコロ", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 0.0, 10, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 2104010, 106401, 10004, 1, -363.0, "シェフィ", 2, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 0.0, 10, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 105801, 12001, 1, -416.5, "ペコリーヌ", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 0.0, 12, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 106001, 13001, 1, -363.0, "キャル", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 0.0, 13, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 105901, 13002, 1, -363.0, "コッコロ", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 0.0, 13, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 2104010, 106401, 13003, 1, -363.0, "シェフィ", 2, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 0.0, 13, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 105801, 13004, 1, -363.0, "ペコリーヌ", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0.0, 13, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 105901, 14001, 1, -363.0, "コッコロ", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 0.0, 14, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 2104010, 106401, 14002, 1, -363.0, "シェフィ", 2, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 0.0, 14, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 105801, 14003, 1, -363.0, "ペコリーヌ", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0.0, 14, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 106001, 14004, 1, -363.0, "キャル", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0.0, 14, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 105901, 15001, 1, -470.0, "コッコロ", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 0.0, 15, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 2104010, 106401, 16001, 1, -363.0, "シェフィ", 2, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 0.0, 16, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 105801, 16002, 1, -363.0, "ペコリーヌ", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 0.0, 16, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 106001, 16003, 1, -363.0, "キャル", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 0.0, 16, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 105901, 16004, 1, -363.0, "コッコロ", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 0.0, 16, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 105901, 17002, 1, -363.0, "コッコロ", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 0.0, 17, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 106001, 17004, 1, -363.0, "キャル", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 0.0, 25, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 105901, 17005, 1, -363.0, "コッコロ", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 0.0, 25, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 2104010, 106401, 17006, 1, -363.0, "シェフィ", 2, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 0.0, 25, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 105801, 17007, 1, -363.0, "ペコリーヌ", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 0.0, 25, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 190801, 18001, 1, -363.0, "カリン", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 0.0, 18, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 190801, 18002, 1, -363.0, "カリン", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 0.0, 18, 0, 2);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 190801, 19001, 1, -470.0, "カリン", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 0.0, 19, 0, 3);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 190801, 19002, 1, -470.0, "カリン", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 0.0, 19, 0, 4);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 190801, 20001, 1, -470.0, "カリン", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 0.0, 20, 0, 5);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 190801, 20002, 1, -470.0, "カリン", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 0.0, 20, 0, 6);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 106001, 21001, 1, -363.0, "キャル", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 0.0, 21, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 105901, 21002, 1, -363.0, "コッコロ", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 0.0, 21, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 2104010, 106401, 21003, 1, -363.0, "シェフィ", 2, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 0.0, 21, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 105801, 21004, 1, -363.0, "ペコリーヌ", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 0.0, 21, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 190801, 22001, 1, -430.0, "カリン", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 0.0, 22, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 190801, 22002, 1, -430.0, "カリン", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 0.0, 22, 0, 2);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 190801, 23001, 1, -430.0, "カリン", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 0.0, 23, 0, 3);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 190801, 23002, 1, -430.0, "カリン", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 0.0, 23, 0, 4);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (4.08, 0, 109001, 24001, 2, -385.0, "エリコ（バレンタイン）", 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 8.0, 24, 10011, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (5.0, 0, 109001, 24002, 2, -385.0, "エリコ（バレンタイン）", 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 8.0, 24, 10011, 2);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (10.11, 0, 109001, 24003, 2, -385.0, "エリコ（バレンタイン）", 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 8.0, 24, 10011, 3);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (4.0, 0, 109001, 24004, 2, -385.0, "エリコ（バレンタイン）", 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 8.0, 24, 10011, 4);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (6.0, 0, 109001, 24005, 2, -385.0, "エリコ（バレンタイン）", 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 8.0, 24, 10011, 5);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 109002, 24006, 1, 0.0, "エリコ（バレンタイン）", 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, 24, 10011, 6);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 109002, 24007, 1, 0.0, "エリコ（バレンタイン）", 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, 24, 10011, 7);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 109002, 24008, 1, 0.0, "エリコ（バレンタイン）", 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, 24, 10011, 8);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 109002, 24009, 1, 0.0, "エリコ（バレンタイン）", 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, 24, 10011, 9);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 109002, 24010, 1, 0.0, "エリコ（バレンタイン）", 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, 24, 10011, 10);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (2.12, 0, 109101, 24011, 2, -385.0, "シズル（バレンタイン）", 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 8.0, 24, 10011, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (4.19, 0, 109101, 24012, 2, -385.0, "シズル（バレンタイン）", 5, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 8.0, 24, 10011, 2);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (2.3, 0, 109101, 24013, 4, -385.0, "シズル（バレンタイン）", 2, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 8.0, 24, 10011, 3);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 109102, 24014, 1, 0.0, "シズル（バレンタイン）", 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0.0, 24, 10011, 4);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (5.23, 0, 109101, 24015, 2, -385.0, "シズル（バレンタイン）", 5, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 8.0, 24, 10011, 5);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 109102, 24016, 1, 0.0, "シズル（バレンタイン）", 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, 24, 10011, 6);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (5.01, 0, 109101, 24017, 2, -385.0, "シズル（バレンタイン）", 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 8.0, 24, 10011, 7);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 109102, 24018, 1, 0.0, "シズル（バレンタイン）", 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, 24, 10011, 8);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 109102, 24019, 1, 0.0, "シズル（バレンタイン）", 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0.0, 24, 10011, 9);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 109102, 24020, 1, 0.0, "シズル（バレンタイン）", 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0.0, 24, 10011, 10);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 2104010, 106401, 26001, 1, -363.0, "シェフィ", 2, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 0.0, 26, 0, 1);
