INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 106001, 26003, 1, -363.0, "キャル", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 0.0, 26, 0, 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 105901, 26004, 1, -363.0, "コッコロ", 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 0.0, 26, 0, 1);
